import React, { useState, useEffect } from 'react';
import { View, Text, TouchableOpacity } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import axios from 'axios';

export default function SkillsScreen() {
  const [responses, setResponses] = useState([]);
  const navigation = useNavigation();
  const [selectedSkills, setSelectedSkills] = useState([]);

  const handleSkillPress = (skill) => {
    let updatedSkills = [...selectedSkills];

    if (updatedSkills.includes(skill)) {
      updatedSkills = updatedSkills.filter((selectedSkill) => selectedSkill !== skill);
    } else {
      updatedSkills.push(skill);
    }

    setSelectedSkills(updatedSkills);
  };

  const handleSubmit = async () => {
    try {
      const response = await axios.post('http://localhost:3000/generate', {
        inputs: selectedSkills,

      });

      setResponses(response.data.responses);
      console.log(responses);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const isSkillSelected = (skill) => {
    return selectedSkills.includes(skill);
  };

  return (
    <View style={{ flex: 1, padding: 16 }}>
      <Text style={{ fontSize: 18, fontWeight: 'bold', marginBottom: 16 }}>
        Basic Skills for Refugees
      </Text>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Language Skills') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Language Skills')}
      >
        <Text style={{ color: isSkillSelected('Language Skills') ? 'white' : undefined }}>
          Language Skills
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Literacy and Numeracy') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Literacy and Numeracy')}
      >
        <Text style={{ color: isSkillSelected('Literacy and Numeracy') ? 'white' : undefined }}>
          Literacy and Numeracy
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Digital Literacy') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Digital Literacy')}
      >
        <Text style={{ color: isSkillSelected('Digital Literacy') ? 'white' : undefined }}>
          Digital Literacy
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Job Readiness') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Job Readiness')}
      >
        <Text style={{ color: isSkillSelected('Job Readiness') ? 'white' : undefined }}>
          Job Readiness
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Cultural Competence') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Cultural Competence')}
      >
        <Text style={{ color: isSkillSelected('Cultural Competence') ? 'white' : undefined }}>
          Cultural Competence
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Financial Management') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Financial Management')}
      >
        <Text style={{ color: isSkillSelected('Financial Management') ? 'white' : undefined }}>
          Financial Management
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Health and Hygiene') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Health and Hygiene')}
      >
        <Text style={{ color: isSkillSelected('Health and Hygiene') ? 'white' : undefined }}>
          Health and Hygiene
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          marginBottom: 16,
          backgroundColor: isSkillSelected('Social and Interpersonal Skills') ? 'blue' : undefined,
          padding: 8,
          borderRadius: 4,
        }}
        onPress={() => handleSkillPress('Social and Interpersonal Skills')}
      >
        <Text style={{ color: isSkillSelected('Social and Interpersonal Skills') ? 'white' : undefined }}>
          Social and Interpersonal Skills
        </Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          backgroundColor: 'blue',
          padding: 12,
          borderRadius: 3,
          alignItems: 'center',
        }}
        onPress={handleSubmit}
      >
        <Text style={{ color: 'white', fontWeight: 'bold' }}>Submit</Text>
      </TouchableOpacity>

      {responses.length > 0 && (
        <View>
          <Text style={{ fontSize: 18, fontWeight: 'bold', marginTop: 20 }}>Generated Responses:</Text>
          {responses.map((response, index) => (
            <Text key={index} style={{ marginTop: 10 }}>{response}</Text>
          ))}
        </View>
      )}
    </View>
  );
}
